import Head from 'next/head';
import styled from 'styled-components';
import Layout from '../components/layout/layout';
import * as GS from '../styles/global';
import Hero from '../components/hero';

export default function Academy() {
	return (
		<>
			<Layout>
				<Hero
					message="From the Ground Up Academy"
					background={`url('/ftgu-academy-header.jpg')`}
					link="Sign Up Now"
					href="/"
				/>
				<GS.MaxContainer>
					<GS.FlexEven>
						<div>
							<h2>Our Training</h2>
							<p>
								Our online training is an in-depth expansion of our YouTube channel and is
								designed to help you navigate the apparel industry from A-Z. With worksheets
								to assist you throughout the training, our goal is to give you all the tools
								you need to successfully launch and grow your brand.
							</p>
							<p>
								In addition to the online training you also get access to a private group, and
								monthly training calls to get your questions answered in real time. This
								program is for those who are ready to take action and see results.
							</p>
							<GS.MainButton>Hello</GS.MainButton>
						</div>
						<div style={{ position: 'relative' }}>
							<GS.PrimaryBlock
								width={'25rem'}
								height={'30rem'}
								borderRadius={'1rem'}
								top={'1rem'}
							/>
							<Profile src="/ftgu-john-academy.webp" width="400" height="571" />
						</div>
					</GS.FlexEven>
				</GS.MaxContainer>
			</Layout>
		</>
	);
}

const Profile = styled.img`
	width: 30rem;
	height: auto;
	float: right;
	border-radius: 1rem;
`;
